import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => {
  return {
    root: {
      minWidth: 275,
      maxWidth: 345,
      textAlign: "center",
      background: "#ADD8E6",
      alignItems: "center",
    },
    pos: {
      marginBottom: 12,
    },
    media: {
      height: "100px",
      width: "100px",
      display: "inline-block",
    },
    text: {
      color: "#FFFFFF",
      fontWeight: "600px",
    },
  };
});
